import React, { Component } from 'react';

class New extends Component {
  render() {
    return (
      <div className="new_wrapper">
        <div className="text">
          <p className="titles">新品首发</p>
          <div className="mone">查看更多 ></div>
        </div>
      </div>
    )
  }
}

export default New
